#nullable enable
namespace HitTheDeck.Resources;
public static class SvgPngImageResource
{
    private readonly static string _cut = "data:image/png;base64,";
    public static string Cut => "cut.png";
    private readonly static string _flip = "data:image/png;base64,";
    public static string Flip => "flip.png";
    public static void Register()
    {
        CommonBasicLibraries.AdvancedGeneralFunctionsAndProcesses.FileFunctions.FileContentRegistry.RegisterFile("cut.png", _cut);
        CommonBasicLibraries.AdvancedGeneralFunctionsAndProcesses.FileFunctions.FileContentRegistry.RegisterFile("flip.png", _flip);
    }
}